document.getElementById("value").addEventListener("change",function(){var t=parseInt(this.value),e=document.getElementsByClassName("path")[0],s=document.getElementsByClassName("path2")[0];if(isNaN(t))t=100;else{var a=e.getAttribute("r"),r=s.getAttribute("r"),n=Math.PI*(2*a),l=Math.PI*(2*r),o=document.getElementById("diagram");if((t<0||t>200)&&(t=0),t>=100){var f=t-100,t=100,i=(100-t)/100*n,d=(100-f)/100*l;e.style.strokeDashoffset=i,s.style.strokeDashoffset=d,o.setAttribute("data-pct",f+100)}if(t<100){var i=(100-t)/100*n;e.style.strokeDashoffset=i,s.style.strokeDashoffset=776,o.setAttribute("data-pct",t)}}});
